L'objectif est de créer une plateforme attrayante, offrant une gamme variée de produits et de services, tout en garantissant la sécurité des données et une livraison efficace. 1. En quoi consiste la boutique en ligne « Idoom Market » ? Idoom Market est une plateforme de commerce en ligne, qui permet aux clients de choisir parmi une gamme variée de produits et de services du dépôt vente, puis de les acheter en ligne en toute simplicité. 2. Comment fonctionne la boutique en ligne « Idoom Market » ? En accédant à la boutique « Idoom Market », les clients ont la flexibilité de sélectionner un ou plusieurs articles de leur choix et de finaliser leurs achats, avec la possibilité de recevoir leur commande à l'adresse de leur choix. 3. Comment procéder à l’achat d’un produit via la boutique en ligne « Idoom Market » ? Pour procéder à l’achat d’un produit sur la boutique en ligne d’Algérie Télécom, il suffit de :
- Accéder à la boutique en ligne, via le lien : idoomarket-at.dz ;
- Faire une inscription (création de compte) ;
- Valider la souscription ;
- Effectuer une recherche pour trouver les produits / services souhaités ;
- Ajouter les articles sélectionnés au panier ;
- Sélectionner la société de livraison ;
- Paiement de la commande en ligne et réception d’une confirmation d’achat ;
- Suivi de l’envoi des commandes à l’aide d’un tracking number (Numéro de suivi). 4.

